import { Outlet, Link } from "react-router-dom";
import './App.css';

const Layout = () => {
  return (
    <>

      <div class="container">
            <nav>
                <ul>
                    <li><a href="#" onclick="smoothScroll('about-me3')">Koti</a></li>
                    <li><a href="#" onclick="smoothScroll('portfolio')">Video</a></li>
                    <li><a href="#" >Lisää</a></li>
                </ul>   
            </nav>
        </div>

      <div class="topnav">
        <li><Link to="/video">Video</Link></li>
        <li><Link to="/">Home</Link></li>
        <li><Link to="/about">About</Link></li>
      </div>

      

      <Outlet />
    </>
  )
};

export default Layout;
